function Convert-FromGzipToText {
    [CmdletBinding()] param(
        [byte[]] $Bytes1
    )
    $is1 = New-Object IO.MemoryStream(, $Bytes1)
    $gs1 = New-Object IO.Compression.GzipStream $is1, ([IO.Compression.CompressionMode]::Decompress)
    $sr1 = New-Object IO.StreamReader($gs1)
    $sbd1 = $sr1.ReadToEnd()
    $sr1.Close()
    $gs1.Close()
    $is1.Close()
    $sbd1
}

function Convert-FromBase64ToGzip {
    [CmdletBinding()] param(
        [string] $AThing
    )
    [Convert]::FromBase64String($AThing)
}

$Modules1 = @($ScriptBlockMain1,$ScriptBlockWin321,$ScriptBlockHelpers1,$ScriptBlockUser1,$ScriptBlockServices1,$ScriptBlockApplications1,$ScriptBlockScheduledTasks1,$ScriptBlockHardening1,$ScriptBlockConfig1,$ScriptBlockNetwork1,$ScriptBlockUpdates1,$ScriptBlockCredentials1,$ScriptBlockMisc1)
$Modules1 | ForEach-Object {
    $Changed = Convert-FromBase64ToGzip -AThing $_
    Convert-FromGzipToText -Bytes1 $Changed | Invoke-Expression
}
